import React, { Component } from 'react';
import './Carousel.css'; // Create a CSS file for styling if needed


import pic01 from '../images/room1.jpeg'
import pic02 from '../images/room2.webp'
import pic03 from '../images/room3.webp'




class Carousel extends Component {
  constructor(props) {
    super(props);
    this.state = {
      components: [<Component1 />, <Component2 />, <Component3 />], // Add your components
      currentIndex: 0,
    };
  }

  componentDidMount() {
    // Start the auto-rotate interval
    this.interval = setInterval(this.rotateComponents, 3000); // Adjust the interval as needed
  }

  componentWillUnmount() {
    // Clear the interval when the component unmounts
    clearInterval(this.interval);
  }

  rotateComponents = () => {
    this.setState((prevState) => ({
      currentIndex:
        (prevState.currentIndex + 1) % this.state.components.length,
    }));
  };

  render() {
    const { components, currentIndex } = this.state;
    return (
      <div className="carousel-container">
        <div className="carousel-component">
          {components[currentIndex]}
        </div>
      </div>
    );
  }
}

export default Carousel;
